	this.frame_30 = function() {
		this.stop();
		var that = this;
		this.button_previous.visible = false;
		this.button_next.visible = false;
		this.button_back.visible = false;
		setTimeout(function(){that.button_previous.visible = true; }, 800);
		setTimeout(function(){that.button_next.visible = true; }, 800);
		setTimeout(function(){that.button_back.visible = true; }, 800);
		
		var currentTimer;
		var interval;
		var lastUpdateTime;
		var now;
		var time;
		var inactivityTimeout;
		var flag = 0;
		
		a();
		function a(){
			that.T_slide_title.color = "#000000";
			currentTimer = 0;
			interval = 0;
			lastUpdateTime = new Date().getTime();
			inactivityTimeout = false;
			autoplay();
			startTimer();
			flag = 0;
		}
		
		
		stage.enableMouseOver(20);
		this.T_slide_title.cursor = "pointer";
		
		
		
		window.addEventListener("mousemove", pauseTimer);
		
		
		function slideshow(){
			V_slide_identifier   = (V_slide_identifier_A*100+V_slide_identifier_B*10+V_slide_identifier_C*1);
			movieclip_imageSlideshow_fadein();
			if(V_language == "english"){
				that.T_slide_title.text = eval("V_slide_titleENG_" + V_slide_identifier_A + V_slide_identifier_B + V_slide_identifier_C);
				that.T_slide_desc.text  = eval("V_slide_descENG_" + V_slide_identifier_A + V_slide_identifier_B + V_slide_identifier_C) ;
			}
			else if(V_language == "japanese"){
				that.T_slide_title.text = eval("V_slide_titleJPN_" + V_slide_identifier_A + V_slide_identifier_B + V_slide_identifier_C);
				that.T_slide_desc.text  = (eval("V_slide_descJPN_" + V_slide_identifier_A + V_slide_identifier_B + V_slide_identifier_C)).replace(/.{68}/g, '$&\n');
			}
		}
		
		function movieclip_imageSlideshow_load(){
			that.movieclip_imageSlideshow.removeAllChildren();
			var new_image = new createjs.Bitmap(V_imgPath + V_slide_identifier + ".jpg");
			that.movieclip_imageSlideshow.addChild(new_image);
		}
		
		function movieclip_imageSlideshow_fadein(){
			movieclip_imageSlideshow_load();
			var movieclip_imageSlideshow_FadeInCbk = fl_FadeSymbolIn.bind(that);
			that.addEventListener('tick', movieclip_imageSlideshow_FadeInCbk);
			that.movieclip_imageSlideshow.alpha = 0;
			function fl_FadeSymbolIn(){
			that.movieclip_imageSlideshow.alpha += 0.03;
			if(that.movieclip_imageSlideshow.alpha >= 1)
			{that.removeEventListener('tick', movieclip_imageSlideshow_FadeInCbk);}}
		}
		
		this.T_slide_title.addEventListener("click", gotoWebsite);
		this.B_slide_title.addEventListener("click", gotoWebsite);
		
		this.T_slide_title.addEventListener("mouseover", changeColor);
		this.B_slide_title.addEventListener("mouseover", changeColor);
		
		this.T_slide_title.addEventListener("mouseout", changeColorDefault);
		this.B_slide_title.addEventListener("mouseout", changeColorDefault);
		
		function changeColor(){
			that.T_slide_title.color = "#3300FF";
		}
		
		function changeColorDefault(){
			that.T_slide_title.color = "#000000";
		}
		
		function gotoWebsite(){
			window.open(eval("V_slide_website_" + V_slide_identifier_A + V_slide_identifier_B + V_slide_identifier_C));
		}
		
		this.button_navigation.addEventListener("click", gotoMaps);
		function gotoMaps() {
			window.open(eval("V_slide_maps_" + V_slide_identifier_A + V_slide_identifier_B + V_slide_identifier_C));
		}
		
		
		this.button_previous.addEventListener("click", previousSlide);
		function previousSlide()
		{
			V_slide_identifier_C--;
			if(V_slide_identifier_C == 0){V_slide_identifier_C = V_slide_maxcounter;}
			autoplay();
			resetTimer();
			startTimer();
		}
		
		
		this.button_next.addEventListener("click", nextSlide);
		function nextSlide()
		{
			V_slide_identifier_C++;
			if(V_slide_identifier_C > V_slide_maxcounter){V_slide_identifier_C = 1;}
			autoplay();
			resetTimer();
			startTimer();
		}
		
		
		this.button_back.addEventListener("click", back2);
		function back2()
		{
			resetTimer();
			flag = 1;
			that.button_back.removeEventListener("click", back2);
			that.button_previous.removeEventListener("click", previousSlide);
			that.button_next.removeEventListener("click", nextSlide);
			that.button_navigation.removeEventListener("click", gotoMaps);
			that.T_slide_title.removeEventListener("click", gotoWebsite);
			that.B_slide_title.removeEventListener("click", gotoWebsite);
			that.T_slide_title.removeEventListener("mouseover", changeColor);
			that.B_slide_title.removeEventListener("mouseover", changeColor);
			that.T_slide_title.removeEventListener("mouseout", changeColorDefault);
			that.B_slide_title.removeEventListener("mouseout", changeColorDefault);
			
			if(V_slide_identifier_A == 1){that.gotoAndStop(21);}
			if(V_slide_identifier_A == 2){that.gotoAndStop(22);}
			if(V_slide_identifier_A == 3){that.gotoAndStop(23);}
			if(V_slide_identifier_A == 4){that.gotoAndStop(24);}
		}
		
		
		
		    function update () {
				if (flag == 0){
		        now = new Date().getTime();
				dt = now - lastUpdateTime;
		
		        currentTimer += dt;
		
		        time = new Date(currentTimer);
		
		        lastUpdateTime = now;
				if (currentTimer >= (V_slideshow_interval *1000)){
					V_slide_identifier_C++;
					if (V_slide_identifier_C > V_slide_maxcounter){V_slide_identifier_C = 1;}
					autoplay();
					resetTimer();
					startTimer();
				}
				}
		    }
		
		    function startTimer() 
			{ if (flag == 0){
		        if (!interval) {
		            lastUpdateTime = new Date().getTime();
		            interval = setInterval(update, 1);
					update();
		        }
			}
		    }
		
		    function stopTimer() {
		        clearInterval(interval);
		        interval = 0;
		    }
			
			function resetTimer() {
		        stopTimer();
		        currentTimer = 0;
		    }
			
			function pauseTimer() {
				stopTimer();
				delay_inactivity();
			}
			
			function delay_inactivity() {
				clearTimeout(inactivityTimeout);
				inactivityTimeout = setTimeout(startTimer, (V_inactivity_interval *1000));
			}
			
			function autoplay(){
				slideshow();
			}
	}

